import React from "react";
import "./Page.sass";
import PlatfromNavbar from "frontend/platform/components/Navbar/PlaformNavbar";

interface IPageProps extends React.HTMLAttributes<HTMLDivElement> {
  pageType: "main" | "website" | "platform";
}

const Page = ({ pageType, children, ...rest }: IPageProps): JSX.Element => {
  return (
    <>
      {pageType === "website" ? <PlatfromNavbar /> : <PlatfromNavbar />}
      <div className="page" {...rest}>
        {children}
      </div>
    </>
  );
};

export default Page;
